import React, { useState } from 'react';
import styled from 'styled-components';
import Friend from './Friend';

const FriendsListBlock = styled.div`
  width: 22%;
  border: 2px solid gray;
  padding: 10px;
  max-height: 650px;
  overflow-y: auto;
`;

const friendsList = [
  {
    profileImage: '1646621980718.jpeg',
    nickname: '123',
  },
  { profileImage: '1646702364540.jpeg', nickname: 'nani' },
  { nickname: 'abcd' },
];

const FriendsList = () => {
  return (
    <FriendsListBlock>
      {friendsList.map(({ profileImage, nickname }) => (
        <Friend profileImage={profileImage} nickname={nickname} />
      ))}
    </FriendsListBlock>
  );
};

export default FriendsList;
